import React from 'react';
import './GoTrainBtnMobile.scss';

const GoTrainBtnMobile = (props) => {

    const handleClick = () => {
        console.log('toggler')
        props.toggle('Help');
        props.toggle('About');
    };

    return(
        <button className="go-train-mobile-btn" onClick={ () => handleClick()} type="button">Go Train</button>
    )
}

export default GoTrainBtnMobile;
